node.text:
@floydmayweather attended the 2021 NBA Finals between Bucks and Suns wearing his million-dollars @jacobandco Royal in 18k white gold invisibly set with diamonds. The case is set with 344 baguette-cut diamonds and one rose-cut on the crown, paired with an insane baguette-cut diamonds bracelet. #JacobandCo

Retail price: $1,000,000.00

Photo : @gettyimages | @jacobandco

@tadejpogacar of UAE Emirates team wins the historic Tour de France for the second time in a row wearing an exclusive @richardmille RM 67-02 Automatic ‘United Arab Emirates’, a few pieces edition secretly released by RM for the @uae_team_emirates. The ultra-light bracelet was not casually chosen in yellow, this color matches the yellow jersey worn by the leader of the general ranking. The RM 67-02 is the lightest automatic watch produced by Richard Mille and weighs only 32 grams thanks to the combination of TPT® composite materials and grade 5 titanium. #RichardMille

Retail price: Not for sale

Photo: @gettyimages | @insaneluxurylife

@ginta during the amfAR Cannes Gala 2021 was wearing a @jacobandco Brilliant Mystery in 18k white gold full set with brilliant-cut diamonds. The hours and minutes are shown in the space between the dial and bezel. The case is set with 298 brilliant-cut diamonds (6.50ct) while the bezel and the dial are set with 145 brilliant-cut diamonds. #JacobandCo

Retail price: $ 84,000.00

Photo: @ginta | @jacobandco

@haileybieber enjoying her yacht vacation wearing a 36mm @rolex Day-Date in 18k yellow gold with an eye-catching turquoise dial. This timepiece has been introduced in 2019 and it features marble-like turquoise dial, the gold hour markers are set with 32 diamonds and the numbers VI and IX are set with 24 diamonds. The Day-Date is certainly the model that Rolex has always created with particular dials. #Rolex

Retail price: $ 55,650.00

Photo: @haileybieber | @rolex
